        Transfer storage t;
        t.puppyAddress = _puppyAddress;
        t.fromAddress = msg.sender;
        t.toAddress = newOwner;
        t.timestamp = block.timestamp;

        transfers[t.timestamp] = t;
        puppies[_puppyAddress].ownerAddress = newOwner;
